 Nasha is the story of an 18 year old          
 boy who falls hopelessly in love with         
 a 25 year old woman. A woman he cannot        
 have, but a woman he cannot help but          
 desire. And, as is the case with              
 desires unfulfilled, they turn into           
 obsessions. And yet, every obsession          
 is a lesson learnt; an experience gained.     
 So that, in the course of coping with his     
 unrequited love, the boy requites a lot       
 more. And both he and the woman come of       
 age. Beyond mere years, in the truest         
 sense of the word. A tale as much of          
 longing as of losing, Nasha is a story        
 that transcends seasons and generations       


